(2982, 'Richard E. Collins', 'richardcollins12548787@gmail.com', NULL, '$2y$10$81BNmMQfFSa19Fy3B0dt4OviFMmQ.D6L6NBUKFtVLHcPhTHuXUnTS', NULL, '(385) 237-4000', 'profile_1640082637.jpg', 'Advisor', 'Active', 'Richard', 'E. Collins', NULL, '489', 'Individual', '489 S Jordan Pkwy Suite 310, South Jordan, UT 84095, United States', NULL, 'W South Jordan Pkwy Ste', 'NJ', 'USA', 'CFA', '1', 'Divergent Wealth Advisors LLC', '16', 'http://www.divergentwealth.com', '#0b5510', 'https://testcaresort.com/twiiter', 'https://testcaresort.com/twwiter', NULL, 'CFP Board makes available information that a CFP', 'Growing up in a rural town in northern Utah was an idyllic life for a young man in my time. My family owned and operated a small dairy farm and from a young age, I helped with daily chores of milking cows, feeding animals, and harvesting and storing crops. The value of hard work and the principals of reaping what you sow and preparing for the lean times were ingrained in my young mind.<br><br>I attended Utah State University in Logan, Utah and after one year in the Electrical Engineering Program, I changed my major to Finance. I was good with numbers but knew that I wanted to work directly with people in my future career goals. It was an immediate fit and I did well and graduated Magna Cum Laude in 1984, with a degree in Finance and minors in Accounting and Economics. &nbsp;<br><br>My first job after graduation was with IBM Corp in Salt Lake City in a sales capacity. In 1987, after several successful years there, I declined a promotion which would have taken my young family away from Utah and started my career as a financial advisor with a regional brokerage firm in Salt Lake City. I was one of the earliest adopters of a âfee-basedâ, commission-free investment platform and quickly integrated financial planning into my practice.<br><br>In 1993, I joined Smith Barney Shearson in Salt Lake City, and earned my CFPÂ® certification. The two-year educational program leading to that was a key in my becoming a financial planning professional and has encouraged me to keep learning and growing as a financial planning practitioner.<br><br>In 2017, my partners, Jordan Collins, Brady Ririe, and I started Divergent Wealth Advisors, an independent and fiduciary investment advisory firm that has allowed us to better serve the needs of our clients.<br><br>Outside the office, I enjoy volunteer work for my church along with biking, hiking, golf, and spending time with my beautiful wife, four children, their spouses and 13 grandchildren.', 7, '5 Years', NULL, NULL, '2021-12-21 10:30:37', '2022-01-04 11:59:07'),
