INSERT INTO `user_articles` (`id`, `user_id`, `name`, `desc`, `image`, `status`, `created_at`, `updated_at`) VALUES
(12, 2982, 'A FAMILY CFO', '<p>Great CEO\'s hire great partners who specialize in turning their visions into reality.</p><p>You\r\n are the CEO of your family and its wealth. Finding the right partner to\r\n be your CFO is one of the most important decisions of your life.&nbsp;</p><p>At\r\n Divergent Wealth, we have no hidden agendas or ulterior motives and \r\nthrive on transparency. Your Divergent Wealth Family CFO is a CFPÂ® \r\ncredentialed planner who will provide un-biased feedback, unyielding \r\nattention to detail, and an ability to simplify complicated things.&nbsp;</p><p>They report their findings and analysis to the CEO (you) who will make the final decision.</p>', 'default_image.png', 'Active', '2021-12-22 10:07:08', '2021-12-22 10:07:08'),
(13, 2982, 'An estate planning attorney', '<p>A great financial plan includes a collaborative estate plan.</p><p>The\r\n problem is, most people do their estate planning and their financial \r\nplanning separately, when in reality they should be done in tandem. But,\r\n to do that requires a credentialed financial adviser that understands \r\nhow those two plans interrelate. &nbsp;</p><h3><br></h3><h3>Instead of just working with your existing estate planning attorney, we decided to take it a step further.</h3><p>Effective\r\n collaboration requires one of the advisers to take the lead. To do \r\nthat, we created the Divergent Wealth Signature Professional program.&nbsp;</p><p>This\r\n program allows us to interview credentialed and experienced estate \r\nplanning attorneys and commit them to effective collaboration, \r\nefficiencies in communication, familiarity with our financial planning \r\nplatform, and high standards of customer service.&nbsp;</p><p><strong>Qualified\r\n clients can then expect Divergent Wealth to pay for some and in many \r\ncases all of the costs incurred when working with these attorneys.</strong></p>', 'default_image.png', 'Active', '2021-12-22 10:09:12', '2021-12-22 10:09:12'),
(14, 2982, 'Coordination with a Tax Professional', '<div class=\"col-xs-12 col-sm-7 col-md-8\"><p>Taxes are a important piece \r\nto consider in your financial planning puzzle. There is a tax impact to \r\nvirtually all investment decisions. Using a competent and qualified tax \r\nadviser who works closely with your financial adviser can increase the \r\ntax-efficiency of your plan.</p><p>Your Divergent Wealth Planner will \r\nstrive to build a relationship and work closely with your current tax \r\nadviser. If you don\'t currently have a valued tax adviser we can provide\r\n you with several professionals to consider.&nbsp;</p><p>When your financial planner and tax adviser work together, the end result is usually better.</p></div>', 'default_image.png', 'Active', '2021-12-22 10:10:28', '2021-12-22 10:10:28'),
(16, 2983, 'Avoid consumer debt like the plague', 'Donec dapibus mauris id odio ornare tempus. Duis sit amet accumsan justo, quis tempor ligula. Quisque quis pharetra felis. Ut quis consequat orci, at consequat felis. Suspendisse auctor laoreet placerat. Nam et', 'article_1640939435.png', 'Active', '2021-12-31 08:30:35', '2021-12-31 08:30:35');
